package com.aire;

import java.util.HashMap;
import java.util.Iterator;
import java.util.Map;

/**
 * @author ZhuPeipei
 * @date 2021/11/30 21:29
 */
public class Exercise242 {
    public static void main(String[] args) {
        String s = "anagram", t = "nagaram";

//        String s = "";
//        String t = "";

        System.out.println(new Exercise242().isAnagram(s, t));
    }

    // 242. 有效的字母异位词
    public boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        Map<Character, Integer> map1 = createMap(s);
        Map<Character, Integer> map2 = createMap(t);
        Iterator<Map.Entry<Character, Integer>> it = map1.entrySet().iterator();
        while (it.hasNext()) {
            Map.Entry<Character, Integer> entry = it.next();
            Integer val = map2.get(entry.getKey());
            if (val == null || val.intValue() != entry.getValue().intValue()) {
                return false;
            }
        }
        return true;
    }

    private Map<Character, Integer> createMap(String s) {
        Map<Character, Integer> map = new HashMap<>();
        for (int i = 0; i < s.length(); i++) {
            char ch = s.charAt(i);
            Integer num = map.get(ch);
            if (num == null) {
                map.put(ch, 1);
            } else {
                map.put(ch, num + 1);
            }
        }
        return map;
    }
}
